class TopicPage extends Component {

    constructor(props) {
        super(props);
        this.state = {
            topic: null,
        };
    }


    componentDidMount() {
        this.getQuestionByID();
    }

    getQuestionByID() {
        this.setState({
            topic: sampleTopic,
        });
    }

    render() {
        const topic = this.state.topic;
        if (!topic) {
            return null;
        }

        const commentCards = topic.answers.map(answer =>
            <Card key={answer.id}>
                <Subheader text={"By " + answer.author}/>
                <Text style={styles.answerTimestamp}>Posted on: {answer.timestamp}</Text>
                <Text style={styles.answerText}>
                    {answer.text}
                </Text>
            </Card>
        );
        return (
            <View style={styles.container}>
                <Toolbar
                    leftElement="arrow-back"
                    onLeftElementPress={() => this.props.navigator.pop()}
                    centerElement={this.props.route.title}
                />
                <ScrollView style={styles.container}>

                    <Card>
                        <Image
                            source={{uri: 'data:image/jpeg;base64,'}}
                            style={{width: 500, height: 200}}
                        />
                        <Subheader text={topic.title}/>
                        <Text style={styles.questionText}>
                            {topic.summary}

                        </Text>

                        <Text style={styles.questionText}>
                            {topic.summary}

                        </Text>

                        <Image
                            source={{uri: 'data:image/jpeg;base64,'}}
                            style={{width: 500, height: 200}}
                        />

                        <Text style={styles.questionText}>
                            {topic.summary}

                        </Text>

                        <Text style={styles.questionText}>
                            {topic.summary}

                        </Text>

                        <Text style={{fontWeight:"bold"}}>
                            Comments:
                        </Text>
                        {commentCards}
                    </Card>

                </ScrollView>
            </View>
        );
    }
}

TopicPage.propTypes = propTypes;
TopicPage.contextTypes = contextTypes;

export default TopicPage;
